import Expenses from "./components/Expenses";

function App() {
  const expense = [
    {
      id: "e1",
      title: "car insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e2",
      title: "car installment",
      amount: 5294.67,
      date: new Date(2021, 2, 9),
    },
    {
      id: "e3",
      title: "car fix",
      amount: 2394.67,
      date: new Date(2021, 2, 2),
    },
    {
      id: "e4",
      title: "car oil",
      amount: 194.67,
      date: new Date(2021, 2, 1),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expense} />
    </div>
  );
}

export default App;
